import React from "react";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="navbar navbar-expand-lg no-gutter fluid d-flex p-3 justify-content-between align-items-center nav-bar">
      <NavLink to="/movieList" className="logo text-warning navbar-brand">Filimo</NavLink>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <div className="bg-dark w-50 d-flex justify-content-evenly align-items-center">
      <NavLink to="/movieList">Home</NavLink>
      <NavLink to="/">Form</NavLink>
      <NavLink to="/logReg">Sign In</NavLink>
    </div>
    </div>
    </div>
  );
};

export default NavBar;
